static int stringHashCode(CategoryPath label) {
  int hash = label.hashCode();

  hash = hash ^ ((hash >>> 20) ^ (hash >>> 12));
  hash = hash ^ (hash >>> 7) ^ (hash >>> 4);

  return hash;

}

